import React, { Component } from "react";
import { Switch, BrowserRouter, Route } from "react-router-dom";
import Menu from "./Component/Menu";
import Home from "./Pages/Home";
import Gozareshat from "./Pages/Gozareshat";
import Setting from "./Pages/Setting";
import ResultItem from "./Pages/ResultItem";
import NotFound from "./Pages/NotFound";

class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <section className="rtl container-fluid h-100">
          <div className="row h-100">
            <Menu />
            <Switch>
              <Route exact path="/" component={Home}/>
                {/* <Home /> */}
              {/* </Route> */}
              <Route path="/Gozareshat" component={Gozareshat}/>
                {/* <Gozareshat /> */}
              {/* </Route> */}
              <Route path="/Setting" component={Setting}/>
                {/* <Setting /> */}
              {/* </Route> */}
              {/* <Route path="/Gozareshat/:id">
              <SearchResult />
            </Route> */}
              <Route exact  path="/Gozareshat/:id" component={ResultItem} />
              <Route path="*" component={NotFound}>
                <NotFound />
              </Route>
            </Switch>
          </div>
        </section>
      </BrowserRouter>
    );
  }
}

export default App;
